import React from "react";

function Footer() {
  return (
    <div className="col-lg-12 footer">
      <div className="iconHolder w-100">
        <div
          style={{
            display: "flex",
            flexDirection: "row",
            justifyContent: "center",
          }}
        >
          <img src="https://img.icons8.com/fluent/48/000000/instagram-new.png" />
          <img src="https://img.icons8.com/fluent/48/000000/instagram-new.png" />
        </div>
      </div>
    </div>
  );
}

export default Footer;
